import { ReactElement, JSXElementConstructor, ReactNode, ReactPortal } from "react";
import "./AllTasks2.css";
import { ColumnProps } from "../../Models/ColumnProps";
import Table  from "../../Table/Table";
import { Task } from "../../Models/Task";

type Data = {
    name: string;
    job: string;
    location: string;
  };

export function AllTasks2(): JSX.Element {
    const data1 = [
        {
          name: 'Cy Ganderton',
          job: 'Quality Control Specialist',
          location: 'Canada',
        },
        {
          name: 'Hart Hagerty',
          job: 'Desktop Support Technician',
          location: 'United States',
        },
        {
          name: 'Brice Swyre',
          job: 'Tax Accountant',
          location: 'China',
        },
      ];
      const columns1: Array<ColumnProps<Data>> = [
        {
          key: 'name',
          title: 'Name',
        },
        {
          key: 'job',
          title: 'Job',
        },
        {
          key: 'location',
          title: 'Color',

          render: (_: any, record: { location: string | number | boolean | ReactElement<any, string | JSXElementConstructor<any>> | Iterable<ReactNode> | ReactPortal | null | undefined; }) => {
            return <div className="text-blue-500 font-bold">{record.location}</div>;
          },
        },
      ];

      const columns: Array<ColumnProps<Task>> = [
        {
          key: 'id',
          title: 'ID',
        },
        {
          key: 'name',
          title: 'Name',
        },
        {
          key: 'responsible',
          title: 'Responsible',
        },
        {
            key: 'scheduledDate',
            title: 'Scheduled For',
        },
        {
            key: 'isCompleted',
            title: 'Completed?',
        },
      ];

    return (
        <div className="AllTasks2">
			<div>
                <Table data={data1} columns={columns1} />
            </div>
        </div>
    );
}
